column3:
@questionzombies 楽天ペイで支払った時
私もつりはいらないよ？😊

と言います

@RPayApp_support 連携はできました！
なのですが、「楽天ペイアプリでSuica連携を選ぶ」「Suicaアプリでカードを選ぶ」『ブラウザでリダイレクトページに飛ぶ』「ストアの楽天ペイページに飛ぶ」
という流れになり、ストアページで「開く」を押しても設定開始前の楽天ペイが開かれるのみになってしまいます

@mii_yu1010 楽天ペイのご利用ありがとうございます😊
楽天ペイが使えて、楽天ポイントもダブルで貯められるお店については以下ページをご確認ください！
https://t.co/EJiVeYFofs

@yuu3578 楽天ペイ公式サポートです😊
楽天ペイのおトクな使い方について以下ページが参考になれば幸いです💁‍♀️
https://t.co/0V5Oqkcrq9

@cheng05 楽天ペイ公式サポートです😊
ポイントがたくさん貯まる、お得なキャンペーンも実施中！ぜひご参加ください
https://t.co/t5hcy855mc

@SagiriSaori 楽天ペイ公式サポートです🙇‍♂️
「楽天キャッシュでのお支払い設定」について以下ページにてご案内しております。お役立ていただければ幸いです🍀
https://t.co/8FwJihI2Wh

@pompom28m いつも楽天ペイをご利用いただき、誠にありがとうございます😊
楽天ポイントが貯まるおトクなキャンペーンを実施中！ぜひご参加ください
https://t.co/t5hcy855mc

@tired_worker ありがとうございます😊
間に合わないかなーと思いましたがギリ間に合いそうだったので思い切って行きました！

期間限定ポイントはいつも楽天ペイで食料品など家計の足しで使ってます。効率よく消化できていいですよ😸

@uRDn_ll 楽天ペイ公式サポートです🙇‍♂️
以下ページより、楽天ペイが使えるお近くのお店をご確認いただけますので、ご活用頂けますと幸いです🍀
https://t.co/RVRJBLGly2

@wichu33 楽天ペイ公式サポートです💡
「クレジットカードでのお支払い設定」について以下ページにてご案内しております。お役立ていただければ幸いです。
https://t.co/lF1zQppSKF

@229_dream 楽天ペイ公式サポートです💁‍♀️
「楽天キャッシュ・楽天ポイントでのお支払い」の際は、お支払い前に設定が必要です。以下ページにて設定方法をご案内しておりますので、次回お支払い時にお役立てください🍀
https://t.co/azprltpZvP

@lilin_isdakr 楽天ペイ公式サポートです💁‍♀️
「楽天キャッシュ・楽天ポイントでのお支払い」の際は、お支払い前に設定が必要です。以下ページにて設定方法をご案内しております。次回お支払い時にお役に立てれば嬉しいです。
https://t.co/azprltpZvP

@amatoh419 楽天のいいところは通常ポイントは無期限(マイル変換用に積立)、ふるさと納税や楽天市場の買い物で期間限定ポイントの還元率高い
街中も楽天ペイや楽天Edyなど、使えるところが多くて、還元率高め。

三井住友はコンビニや外食チェーンでのスマホタッチ決済(クレカ)で有利

@ikinariwasavi ありがとうございます✨✨
30口のほうが人数は多いので確率は上がると思うのですが、10口で何回もできた方が楽しいかなと思ったり、、、逆に5口で6回とかでも楽しいですかね🤔わたしも悩みどころです😭💦
paypay、メルペイ、楽天ペイどれでも対応可能です🙇‍♀️🙇‍♀️

@sora_ZARD こんにちは！
私もずっと手を付けてませんでしたが、今年春に楽天ペイデビューしました☝️
何だかんだと今まで無かったポイントが付くので、得にはなってますよ😊
